    const {id} = useParams()
    const [arrayproductosclon,SETarrayproductosclon] = useState(arrayproductos)
    SETarrayproductosclon(
        [
            ...arrayproductosclon,producto = id
        ]
    )
    console.log(arrayproductosclon)
}
export default Carritoback

